  uint256 public ethPrice;
  uint256 public linkPrice;

  constructor(
  ) {
    btcPrice = 2500000000000;
    ethPrice = 160000000000;
    linkPrice = 750000000;
  }

  function setBTCPrice(uint256 _price) public returns (uint256) {
    btcPrice = _price;
