  function setETHPrice(uint256 _price) public returns (uint256) {
    ethPrice = _price;
    return ethPrice;
  }

  function setLinkPrice(uint256 _price) public returns (uint256) {
    linkPrice = _price;
    return linkPrice;
  }
}

